import React, { useEffect } from 'react';
import { Link } from 'react-router-dom';
import { compose } from 'redux';
import { connect } from 'react-redux';
import { setAppInitialized } from '../redux/gameState-reducer';

const GameStart = (props) => {
    useEffect(() => {
        props.setAppInitialized();
    }, [])
    return (
        <div>
            {/* <GameLogo />
            <MainText /> */}
            <Link to='/game'>
                <button>Start</button>
            </Link>
        </div>
    )
}


export default compose(connect(null, { setAppInitialized }))(GameStart);
